import React, { Component } from "react";
/*
const RegisteredUserProfile = ({ user }) => {
  return (
    <React.Fragment>
      <h1>My profile:</h1>
      <div>
        Profile type: {user.role === "RegUser" ? "Registered user" : "Employee"}
      </div>
    </React.Fragment>
  );
};

export default RegisteredUserProfile;
*/
class RegisteredUserProfile extends Component {
  state = {
    user: {},
  };
  componentDidMount() {
    this.setState({ user: this.props.user });
  }
  render() {
    return (
      <React.Fragment>
        <h1>My profile:</h1>
        <div>Profile type: {this.state.user.role}</div>
      </React.Fragment>
    );
  }
}

export default RegisteredUserProfile;
